INSERT INTO `notes` VALUES (_binary '$Ջ\0\rn)','balayya','నందమూరి బాలకృష్ణ ఒక తెలుగు సినిమా నటుడు, నిర్మాత, శాసనసభ సభ్యుడు. బాలకృష్ణ వైవిధ్యభరితమైన పాత్రలు పోషించడమేకాక, పౌరాణిక, జానపద, సాంఘిక చిత్రాలలో చేయుటకు ప్రసిద్ధి. తన సినీజీవితంలో ఎన్నో తెలుగు సినిమాలు చెయ్యడం వలన తెలుగువారికి సుపరిచితుడు. ఇతను నటసార్వభౌమ ఎన్.టి.రామారావు కుమారుడు.','2023-06-09 05:04:42','syam'),(_binary 'C\3\0\rn)','chatrapathi shivaji maharaj','Shivaji I (Shivaji Bhonsle; Marathi pronunciation: [ʃiʋaːd͡ʒiˑ bʱoˑs(ə)leˑ]; c.19 February 1630 – 3 April 1680[5]), also referred to as Chhatrapati Shivaji Maharaj, was an Indian ruler and a member of the Bhonsle Maratha clan.[6] Shivaji carved out his own independent kingdom from the declining Adilshahi sultanate of Bijapur which formed the genesis of the Maratha Empire. In 1674, he was formally crowned the Chhatrapati of his realm at Raigad Fort.\r\n\r\nOver the course of his life, Shivaji engaged in both alliances and hostilities with the Mughal Empire, the Sultanate of Golkonda, Sultanate of Bijapur and the European colonial powers. Shivaji\'s military forces expanded the Maratha sphere of influence, capturing and building forts, and forming a Maratha navy. Shivaji established a competent and progressive civil rule with well-structured administrative organisations. He revived ancient Hindu political traditions, court conventions and promoted the usage of the Marathi and Sanskrit languages, replacing Persian in court and administration.\r\n\r\nShivaji\'s legacy was to vary by observer and time, but nearly two centuries after his death, he began to take on increased importance with the emergence of the Indian independence movement, as many Indian nationalists elevated him as a proto-nationalist and hero of the Hindus.','2023-06-09 05:09:17','syam'),(_binary 'Z\\0\rn)','vijay thalapathi','Joseph Vijay Chandrasekhar (born 22 June 1974[2][3]), known professionally as Vijay, is an Indian actor and singer who works predominantly in Tamil cinema.[4][5] He is among the highest paid actors in India[6][7] and has featured in Forbes India\'s Celebrity 100 list on seven occasions.[8][9] He has played the lead in 66 films and the International Business Times framed him as a \"consistent performer\".[10] Referred to as Thalapathy (transl. Commander), Vijay has a significant following internationally.[11][6] He has won several awards, including an Osaka Best Actor Award and a South Indian International Movie Award.','2023-06-09 05:06:12','syam'),(_binary '2\0\rn)','ganesh','hello bava\r\n','2023-06-06 06:22:34','Mohith'),(_binary '\&\0\rn)','anushka jayaraj','Anushka Jayaraj is a famous Star & Miss Kerala in 2021. She has lot of fans in both of Kerala & Tamil Nadu. Behind the major reason was her Hair only. Most of boys of addicted her videos & hair style. This is the primary reason for she selected as Miss Kerala award in last year.\r\n\r\nAnushka has lot of followers in Instagram account. Totally 480K fans & she was regularly posting reels on social media sites. May be in the future she get a chance for moving on film industry. Just wait and let’s what happened on future.\r\n\r\n','2023-06-09 05:08:21','syam'),(_binary '\7<40\0\rn)','codegnan','hello\r\n','2023-06-06 06:11:18','Mohith');
